INSERT INTO `custom2` VALUES ('abouttxt','<p><span style=\"font-size: 16pt;\"><strong>What is the Gleaning Project?</strong></span></p>\r\n\r\n<p><span style=\"font-size: 12pt;\">The Gleaning Project is a volunteer program of Harvest Pierce County and the Pierce Conservation District that works to reduce the amount of produce wasted in our community, provide more fresh food to those in need, and build community. This community based effort is a response to the dramatic increase in the number of people seeking food assistance in our county.\r\n</span></p>\r\n\r\n\r\n<p><center><strong style=\"font-size: 1em;\">Since 2009, volunteers have harvested and shared over 300,000 lbs of fruit and produce. w</strong><strong style=\"font-size: 1em;\"> of produce from farms</strong></center></p>\r\n\r\n<p> <img src=\"http://piercecountygleaningproject.org/images/produce.jpg\"/>\r\n</p>\r\n<p>\r\n<div style=\"float: left; width: 48%;text-align: center\">  \r\n\r\n<p><span style=\"font-size: 14pt;\"><strong>Farm Gleans</strong></center></p>\r\n<div style=\"text-align: center;\"><img src=\"http://piercecountygleaningproject.org/images/rhubarb.jpg\" width=\"150\" height=\"150\" align=\"middle\"/></div>\r\n<p><div style=\"text-align: left\"<span style=\"font-size: 12pt\"> Most farmers are never able to sell everything they produce. Even if the produce is fresh, sometimes farmers are limited by regulations and aesthetics. Harvest Pierce County staff work with local farmers and organizes groups of  volunteers to glean produce from their fields that they can no longer sell. The bounty is then distributed to food banks, meal sites, and community organizations. We also support volunteers to glean leftover food from vendors at Pierce County farmers markets. </div></p></span>\r\n</div>\r\n\r\n\r\n<div style=\"float: right; width: 48%;\"> <div style=\"text-align: center;\">\r\n<p><span style=\"font-size: 14pt;\"><strong>Neighborhood Fruit Gleans</strong></p></div>\r\n<div style=\"text-align: center;\"><img src= \"http://piercecountygleaningproject.org/images/fruit.jpg\" width=\"150\" height=\"150\" align=\"middle\"></div>\r\n<p> <span style=\"font-size: 12pt;\"> Fruit Trees can be abundant  producers. Many people have fruit trees on their property that produce more than they can handle or never even get harvested!  We work to  prevent fruit waste by organizing volunteers to harvest trees at the homeowners request and share the bounty with local food banks and shelters.  <br>\r\n<br><br></p></span>\r\n</div>\r\n</p>\r\n <p>\r\n<p></p>\r\n<div style=\"float: center\">\r\n<p><center><span style=\"font-size: 14pt;\"><strong>Work Parties and Events</strong></center></p>\r\n<center><img src= \"http://piercecountygleaningproject.org/images/Pruning.jpg\" width=\"150\" height=\"150\" align=\"middle\"/></center>\r\n<p> <span style=\"font-size: 12pt;\"> Throughout the year we host various work parties and community outreach events to spread the word about the Gleaning Project including everything from fruit tree classes to harvest celebrations!.</p></span>\r\n</div>\r\n\r\n\r\n<p><i><center> Sign up for our monthly newsletter and/or weekly harvest updates!</i></p>\r\n\r\n<input type=button onClick=\"parent.location=\'http://eepurl.com/Yfbbf\'\" value=\'Email subscriptions\'></input></center>\r\n'),('supporttxt','<h3><strong>Support</strong><h3>\r\n<h3><center>Volunteer</h3></center>\r\n<p> The best you way you can support the Gleaning Project is by <strong><a href=\"http://firstharvest.org/volunteer.php?org=a86bf\">volunteering</a></strong> as a harvester!</p>\r\n<h3><center>Donate Produce or Fruit</h3></center>\r\n<p>\r\nIf you have extra fruit or produce that you cannot pick or sell, please consider donating <b><a href=\"http://firstharvest.org/crop_registration.php\">donating your farm produce</a></b> or <a href=\"http://firstharvest.org/crop_registration.php\"><b>your backyard fruit crop</a></b>. Read more about our policies here!</p>\r\n\r\n<h3><center> Material Donations</h3></center>\r\n<p>Gleaning is by definition using resources that others cannot! If you have any supplies on the following list that you no longer use, we will put them to good use!</p>\r\n<ul><b>\r\n\r\n<li> Wheelbarrows\r\n<li> Orchard Ladders (\"tripod\" ladders)\r\n<li> Fruit Harvesters\r\n<li> Hand Clippers, Loppers, Pruning Saws, and Pole Saws\r\n<li> Digging/harvesting knives (hori-horis, sharp serrated knives)\r\n<li> A Cider Press!\r\n</b>\r\n</ul>\r\n\r\n<h4><center> If you would like to donate materials to the Gleaning Project, please email Matt at <a href=\"mailto:MattP@piercecountycd.org?subject=Donating%20to%20the%20Gleaning%20Project\">MattP@Piercecountycd.org<a> or call 253-278-6215.</h4>\r\n\r\n\r\n\r\n'),('waivertxt',''),('presstxt','<h3><strong>Recognition</strong></h3>\r\n<h3><i>The Gleaning Project has been featured in articles by community members and the news media - here are some highlights!</h3></i>\r\n\r\n<p><b><a href=\"http://www.cityoftacoma.org/cms/one.aspx?objectId=55748\">Urban Green - Episode 4 (3:20)</b></a> - The Gleaning Project is featured on a segmant on Amazing Trees.</p>\r\n<p> \r\n<i><b>\"I was so grateful for their help and told my family and neighbors about the program. We were all blessed by the abundance of my fruit trees and the generosity of the Gleaners.  The program gave me the opportunity to share in a way that was not possible on my own.  I needed the team of many people working together to share fresh, local food.\" -Helen Bache, Homeowner and volunteer</i></b>\r\n<p>\r\nRead more: <a href=\"http://www.smlutheran.org/archives/3658\">A Shared Abundance: The Pierce County Gleaning Project - Helen Bache (December 2013)</a>\r\n</p>\r\n\r\n<p>\r\n <i><b>\"If you hate to see good food go to waste, youâ€™ll be relieved to hear that The Pierce County Gleaning Project is actively working towards a solution.\"</i></b><br><br> \r\nRead more:<a href=\"http://fishfoodbanks.blogspot.com/2012/06/pierce-county-gleaning-project.html\"> FISH Wrap - June 2012</a>\r\n</p>\r\n\r\n\r\n<p><b>More Articles:</p>\r\n<p>\r\n<a href=\"https://www.gtcf.org/blog/grantee-spotlight-pierce-county-gleaning/\">Greater Tacoma Community Foundation Grantee Spotlight</a>\r\n</p>\r\n<p>\r\n<a href=\"http://postdefiance.com/gleaning-the-block/\">Gleaning the Block - Katy Evans</a>\r\n</p>\r\n\r\n<p>\r\n<a href=\"http://www.piercecountycd.org/images/tahomaViewPDFs/thm_vw_sum13.pdf\">Tahoma View - Summer 2013</a>\r\n</p>\r\n\r\n'),('supporterstxt',' <h4><i>The Pierce County Gleaning Project could not happen without the support of our agricultural community and partner organizations.</i></h4>\r\n<h3 style=\"text-align: center;\"></h3>\r\n<h3><strong>Farmers:</strong></h3>\r\n<h4>In addition to providing our whole community with nourishing food, the following farmers have gone the extra mile and donated fresh produce that would have otherwise gone to waste into the emergency food system through gleaning and other avenues. Please consider supporting them when you are out doing your shopping!</h4>\r\n\r\n<div><a href=\"http://sanfordsfarm.com/\"><img style=\"float:left; width:150px; margin:10px\" src=\"http://piercecountygleaningproject.org/images/sanford.jpg\"/>\r\n<a href=\"http://sanfordsfarm.com/\"><h3 style=\"text-align:center;\"> Sanford\'s Farm - Orting, WA </h3></a>\r\n<p>Jeremy and Angela Sanford (and their three kids) are moving into their 2nd full season on their beautiful Orting valley farm. In 2013, We gleaned some delectable cucumbers from Sanford\'s! The 32 acre farm features fresh eggs and veggies!><p><strong>You can find Sanford\'s at:</strong> Their farm stand (opening soon!), and their CSA.\r\n</div>\r\n\r\n<div><a href=\"http://www.terrysberries.com/Home_Page.html\"><img style=\"float:left; width:150px; margin:10px\" src=\"http://piercecountygleaningproject.org/images/terries.jpg\" /></a>\r\n<a href=\"http://www.terrysberries.com/Home_Page.html\"><h3 style=\"text-align:center;\"> Terry\'s Berries (and Veggies too!) </h3></a>\r\n<p>Terry and Dick Carkner are long-standing members of the south sound farming community, as well a long-time supporter of the Gleaning Project. We  gleaned and culled lettuce and squash from Terry\'s in 2013. Terry\'s 25 acre  organic farm  has a year-round CSA, a super-cool farm store, and tons of thriving berries!</p><p><strong>You can Find Terry\'s Berries at: </strong>On-site farm store, CSA, Tacoma Farmers Markets, and the Tacoma Food Coop (eggs).</p>\r\n</div>\r\n\r\n<div><a href=\"http://www.zestfulgardens.org\"><img style=\"float:left; width:150px; margin:10px;\" src=\"http://piercecountygleaningproject.org/images/zestful.jpg\" /></a>\r\n<a href=\"http://www.zestfulgardens.org\"><h3 style=\"text-align:center;\"> Zestful Gardens</h3></a>\r\n<p>Zestful Gardens is an organic farm run by the mother-daughter team of Val and Holly Foster. The  beautiful 35-acre farm features an abundance of fresh veggies as well as meat and eggs. Zestful donated thousands of pounds of potatoes to the Gleaning Project last season!</p>\r\n<p><strong>You can find Zestful Gardens at:</strong> The Broadway, Proctor, and Stielacoom farmers markets, the Tacoma Food Coop. Zestful also has a great CSA!</p>\r\n</div>\r\n\r\n<div><a href=\"http://www.filbertacresfarm.com\"><img style=\"float:left; width:150px; margin:10px\" src=\"http://piercecountygleaningproject.org/images/filbert.jpg\" /></a>\r\n<a href=\"http://www.filbertacresfarm.com\"><h3 style=\"text-align:center;\"> Filbert Acres</h3></a>\r\n<p>Filbert Acres is a wonderful family farm run by Jonathon and Alison Nichols in the Puyallup valley. The Nichols bought the farm in 2009 and have replanted a major portion of the Filbert Orchard with a new generation of trees while growing tons of beautiful veggies! Filber also features a fantastic pork operation available now (Spring 2014). We have harvested Carrots, peas, and and beets from Filbert Acres in 2013 and 2014.\r\n\r\n<p><strong>You can find Filbert Acres at:</strong>on-site at the farm (Saturdays 8am-2pm), their CSA</p>\r\n</div>\r\n\r\n<a href=\"http://www.littleeorthe.org\"><div><img style=\"float:left; width:150px; margin:10px\"\r\nsrc=\"http://piercecountygleaningproject.org/images/littleeorthe.jpg\" /></a>\r\n<a href=\"http://www.littleeorthe.org\"><h3 style=\"text-align:center;\">Little Eorthe</h3></a>\r\n<p>Little Eorthe is run by Carrie Little and her husband Ken. Little Eorthe is a incredibly dynamic farm that includes tons of wonderful organically produced veggies, berries, meat, flowers, beer, hops, honey, and eggs!\r\n<p><strong>You can find Little Eorthe at:</strong> The Proctor Farmers Market, their CSA. </p>\r\n</div>\r\n\r\n<a href=\"http://www.pichafarms.com\"><div><img style=\"float:left; width:150px; margin:10px\"\r\nsrc=\"http://piercecountygleaningproject.org/images/picha.jpg\"/> </a>\r\n<a href=\"http://www.pichafarms.com\"><h3 style=\"text-align:center;\">Picha Farms</h3></a>\r\n<p>Picha Farms is a third generation farm run by Dan, Russ, and Diane Picha. The Pichas grow bountiful berry crops in the summer and corn and pumpkins in the later months. Make sure to check out there corn maze and pumpkin patch in the fall! We have harvested raspberries, pumpkins, and corn over the past two seasons.</p> \r\n<p><strong>You can find Picha Farms at:</strong>Their farm stand  \r\n</div>\r\n\r\n<a href=\"http://www.duriscucumberfarm.com\"><div><img style=\"float:left; width:150px; margin:10px\" src=\"http://piercecountygleaningproject.org/images/duris.jpg\"/></a>\r\n<a href=\"http://www.duriscucumberfarm.com\"><h3 style=\"text-align:center;\">Duris\' Cucumber Farm</h3></a>\r\n<p>Tom Duris runs this 2nd generation farm in the fertile Puyallup Valley. Duris has donated thousands upon thousands of pounds over the last several season to the Gleaning Project as well as SE FISH food bank and other emergency food sites!\r\n<p><strong>You can find Duris at:</strong> Their farm stand (featuring much more than cukes!)\r\n</div>\r\n\r\n<a href=\"http://www.tahomafarms.com\"><div><img style=\"float:left; width:150px; margin:10px\"\r\nsrc=\"http://piercecountygleaningproject.org/images/tahoma.jpg\"></a>\r\n<a href=\"http://www.tahomafarms.com\"><h3 style=\"text-align:center;\">Tahoma Farms</h3></a>\r\n<p>Tahoma Farms is a 40 acre organic farm located in the rich Orting Valley. Kim and Dan Hulse are first generation farmers who purchased the farm in 2009. Tahoma grows an incredible variety of beautiful veggies that are found at markets across Puget Sound. Kim and Dan frequently donate to the emergency food system through Tahoma farms and Terra Organics. \r\n<p><strong>You can find Tahoma at:</strong> Tacoma Food Coop, Marlene\'s Markets, Their CSA, and many other Puget Sound locations.\r\n</div>\r\n\r\n<a href=\"https://www.facebook.com/pages/Scholz-Farm/126452464076234\"><div><img style=\"float:left; width:150px; margin:10px\"\r\nsrc=\"http://piercecountygleaningproject.org/images/scholz.jpg\"></a>\r\n<a href=\"https://www.facebook.com/pages/Scholz-Farm/126452464076234\"><h3 style=\"text-align:center;\">Scholz Farms</h3></a>\r\n<p>Scholz farms is a 4th generation family farm in the orting valley. Alan Scholz and his team grow thousands of pounds of rhubarb, corn, and other veggies every year that is distributed across the county! We harvested Rhubarb and Corn the in our 2012 season from Scholz!\r\n<p><b>You can find Scholz at:</b> Their farm store, U-Pick, Puget sound produce stands.</p>\r\n</div>\r\n\r\n<h3><center>Thank you to our Registered Fruit Tree Owners!</h3></center>\r\n<p>\r\n<style type=\"text/css\">\r\n.three {\r\n    -webkit-column-count: 3; /* Chrome, Safari, Opera */\r\n    -moz-column-count: 3; /* Firefox */\r\n    column-count: 3;}\r\n</style>\r\n<div class=\"three\">\r\n<ul type=none\'> \r\n\r\n<li>\r\n					Courtney & Rob Love</li>\r\n				<li>\r\n					Lou & Janey Rall</li>\r\n				<li>\r\n					Erik & Kristen Brubaker</li>\r\n				<li>\r\n					Ri