nds picked in 2016 +Renee+','select concat(fname,\' \',lname) as name, sum(totwgt) as \'total pounds harvested\' from pickers, rosters, harvests where rosters.ID_picker=pickers.ID_picker and harvests.ID_harvest=rosters.ID_harvest and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(h_date)=\'2016\' group by pickers.ID_picker order by sum(totwgt) desc'),(158,'Most harvests attended in 2016 +Renee+','select concat(fname,\' \',lname), count(ID_rosters) from pickers, rosters where rosters.ID_picker=pickers.ID_picker and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(rosters.regdate)=\'2016\' group by pickers.ID_picker order by count(ID_rosters) desc'),(159,'Total weight by year +Webmaster+','select year(h_date), sum(totwgt) from harvests group by year(h_date)'),(160,'Harvest leaders and their leader designation (data check) +Webmaster+','select ID_picker, lname, leader from harvests, pickers where harvests.ID_leader=pickers.ID_picker group by ID_picker order by leader'),(161,'All sites listed by their most recent harvests date +Site stats+','select sites.ID_site, max(h_date) from sites left join harvests on sites.ID_site=harvests.ID_site group by sites.ID_site order by max(h_date)'),(162,'All zip codes in the Sites table +Site stats+','select zip, count(zip) as \'sites in this zip\', ID_site as \'Site ID if only one - use to identify errors\' from sites group by zip order by zip'),(163,'All branches and number of sites +Sites stats+','select branches.branch, count(branches.branch) from sites left join branches on branches.branch=sites.branch group by branch'),(164,'Sites with branch = Unknown +Sites stats+','select ID_site, farm, zip, branch from sites where branch=\'Unknown\' and Active=\'Yes\''),(165,'Harvests with signup entries not updated +Harvest stats+','select fname, lname, h_date, rosters.ID_harvest, count(rosters.status) as \'signup slots\' from rosters, pickers, harvests where rosters.ID_harvest=harvests.ID_harvest and pickers.ID_picker=harvests.ID_leader and rosters.status=\'signup\' group by rosters.ID_harvest order by lname'),(166,'<strong>Total pounds to this point in the year, by year</strong> +Harvest stats+','select year(h_date) as year, count(harvests.ID_harvest) as harvests, sum(totwgt) as \'weight\' from harvests, sites where sites.ID_site=harvests.ID_site and dayofyear(h_date)<=dayofyear(curdate()) and substring(h_date,-2)<>\'00\'  and totwgt>0 group by year(h_date)'),(167,'Branch Leader Harvest List 2020','select h_date, ID_leader, where_to from harvests where h_date between \'2020-01-01\' and \'2020-10-30\' order by ID_leader\r\n'),(168,'Data dump of all sites +Sites stats+','select * from sites order by regdate desc'),(169,'Time Duration of Harvest According to Picker ID','select year(h_date), (ID_harvest), pick_num, status, sum(duration) from harvests where pick_num>1 and h_date>\'2020-01-01\' group by (ID_harvest)'),(173,'Volunteer registrations by number of registrations per day - by date +Webmaster+','select regdate, count(ID_picker) from pickers group by regdate order by regdate desc '),(171,'Volunteer registrations by number of registrations per day +Webmaster+','select regdate, count(ID_picker) from pickers group by regdate order by count(ID_picker) desc '),(172,'Volunteer registrations on a given day +Webmaster+','select fname, lname from pickers where regdate=\'2021-08-02\' '),(174,'Volunteer registrations by first name length +Webmaster+','select fname, lname from pickers order by length(fname) desc'),(175,'Volunteer registrations by state +Webmaster+','select fname, lname, length(lname), regdate, state from pickers where state<>\'\' and state<>\' \' and state<>\'WA\' and state<>\'OR\' and state<>\'ID\' and state<>\' W\' and state <>\'wa\' and state<>\'/\' and state<>\'48\' and state<>\'49\' order by state'),(176,'Volunteer registrations by zip length +Webmaster+','select fname, lname, zip from pickers where length(zip)>5 order by state');
